import React, { useEffect } from "react";

const Footer = () => {
  useEffect(() => {
    async function fetchLinksFunction() {
      const result = await `https://www.themoviedb.org/about`;
      return result;
    }
    fetchLinksFunction();
  });

  return <div></div>;
};

export default Footer;
